import React from 'react';
import GoogleMapReact from 'google-map-react';

const AnyReactComponent = ({ text }) => {
    return <div style={{
        borderStyle: 'solid',
        width: 100
        }}>
        <p>{text}</p>
        </div>
}

const WorldMap = (props) => {    
    return (
        <div style={{ height: '50em' }}>
          <GoogleMapReact
            bootstrapURLKeys={{ key: "AIzaSyAsrq4RaFfBOlCImHHNa9N_0QEj7gx0P9o" }}
            defaultCenter={props.center}
            defaultZoom={props.zoom}
          >
            <AnyReactComponent
              lat={40.727336961935315}
              lng={-73.99893844399342}
              text="My Marker"
            />
          </GoogleMapReact>
          <div>

          </div>
        </div>
      );
}

WorldMap.defaultProps = {
    center: {
      lat: 39.67197697791948, 
      lng: -98.08226562598172
    },
    zoom: 4
  };


export default WorldMap
